import { useEffect, useState } from 'react';

const AdminDashboard = () => {
  const [users, setUsers] = useState([]);
  const [classes, setClasses] = useState([]);
  const [newUser, setNewUser] = useState({ username: '', email: '', password: '', role: 'student' });
  const [newClass, setNewClass] = useState({ name: '', description: '', instructor_id: '', semester: '', start_date: '', end_date: '' });
  const [associations, setAssociations] = useState({ student_id: '', class_id: '', parent1_id: '', parent2_id: '' });

  useEffect(() => {
    const fetchUsersAndClasses = async () => {
      const usersRes = await fetch('http://localhost:5001/api/users/all');
      const classesRes = await fetch('http://localhost:5001/api/classes/all');
      setUsers(await usersRes.json());
      setClasses(await classesRes.json());
    };

    fetchUsersAndClasses();
  }, []);

  const handleCreateUser = async () => {
    await fetch('http://localhost:5000/api/admin/create-user', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newUser),
    });
    setNewUser({ username: '', email: '', password: '', role: 'student' });
  };

  const handleCreateClass = async () => {
    await fetch('http://localhost:5000/api/admin/create-class', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify(newClass),
    });
    setNewClass({ name: '', description: '', instructor_id: '', semester: '', start_date: '', end_date: '' });
  };

  const handleAssignStudentToClass = async () => {
    await fetch('http://localhost:5000/api/admin/assign-student-to-class', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ student_id: associations.student_id, class_id: associations.class_id }),
    });
  };

  const handleAssignParent = async () => {
    await fetch('http://localhost:5000/api/admin/assign-parent', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ student_id: associations.student_id, parent1_id: associations.parent1_id, parent2_id: associations.parent2_id }),
    });
  };

  return (
    <div className="p-6">
      <h1 className="text-3xl font-bold mb-6">Admin Dashboard</h1>

      {/* Create User */}
      <div className="mb-6">
        <h2 className="text-xl font-semibold">Create User</h2>
        <input type="text" placeholder="Username" value={newUser.username} onChange={(e) => setNewUser({ ...newUser, username: e.target.value })} />
        <input type="email" placeholder="Email" value={newUser.email} onChange={(e) => setNewUser({ ...newUser, email: e.target.value })} />
        <input type="password" placeholder="Password" value={newUser.password} onChange={(e) => setNewUser({ ...newUser, password: e.target.value })} />
        <select value={newUser.role} onChange={(e) => setNewUser({ ...newUser, role: e.target.value })}>
          <option value="admin">Admin</option>
          <option value="instructor">Instructor</option>
          <option value="student">Student</option>
          <option value="parent">Parent</option>
        </select>
        <button onClick={handleCreateUser}>Create</button>
      </div>

      {/* Assign Student to Class */}
      <div>
        <h2 className="text-xl font-semibold">Assign Student to Class</h2>
        <button onClick={handleAssignStudentToClass}>Assign</button>
      </div>

      {/* Assign Parents to Student */}
      <div>
        <h2 className="text-xl font-semibold">Assign Parents</h2>
        <button onClick={handleAssignParent}>Assign</button>
      </div>
    </div>
  );
};

export default AdminDashboard;
